                var topic = _factory.TopicRepository.FindById(id);
                if (topic == null)
                {
                    return View("ResourceNotFound");
                }
                ViewBag.TopicName = topic.NameOfTopic;
                ViewBag.Description = topic.Description;
                ViewBag.Topic1 = topic.TopicId;        
                return View(PublicationService.GetPublicationsOfTopic(_factory,id));
            }
            catch (Exception ex)
            {
                logger.Error(ex, ex.Message);
                return View("Error", new HandleErrorInfo(ex, "Publications", "Index1"));
            }
        }
