        // POST: Publications/Create
        // Чтобы защититься от атак чрезмерной передачи данных, включите определенные свойства, для которых следует установить привязку. Дополнительные 
        // сведения см. в статье http://go.microsoft.com/fwlink/?LinkId=317598.
        [HttpPost]
        [Authorize(Roles = "Admin")]
        public ActionResult Create(PublicationViewModel publicationViewModel, HttpPostedFileBase file)
        {
            try
            {            
                if (ModelState.IsValid)
                {
                    publicationViewModel.AllTopics = _factory.TopicRepository.Get();
                    ViewBag.Name = "";
                    if (PublicationService.ExistNameOfPublication(_factory, publicationViewModel.NameOfPublication))
                    {
                        ViewBag.Name = "Издание с таким названием уже существует";
                        return View(publicationViewModel);
                    }
                    List<Topic> topics = new List<Topic>();
                    foreach (var i in publicationViewModel.OwnTopics)
                    {
                        int topicId = Int32.Parse(i);
                        var topic = _factory.TopicRepository.FindById(topicId);
                        topics.Add(topic);
                    }


                    var publicationObj = new Publication
                    {
                        NameOfPublication = publicationViewModel.NameOfPublication,
                        Description = publicationViewModel.Description,
                        Periodicity = publicationViewModel.Periodicity,
                        Format = publicationViewModel.Format,
                        Color = publicationViewModel.Color,
                        Volume = publicationViewModel.Volume,
                        PricePerMonth = publicationViewModel.PricePerMonth,
                        Topics = topics
                    };
                    if (file != null && file.ContentType.StartsWith("image"))
                    {
                        publicationObj.ImgMimeType = file.ContentType;
                        publicationObj.ImageBytes = new byte[file.ContentLength];
                        file.InputStream.Read(publicationObj.ImageBytes, 0, file.ContentLength);
                    }
                    _factory.PublicationRepository.Add(publicationObj);
                    logger.Info("Издание {0} было добавлено", publicationObj.NameOfPublication);
                    TempData["SuccessMessage"] = "Издание было добавлено.";
                    return RedirectToAction("Index");
                }

                return View(publicationViewModel);
            }
            catch (Exception ex)
            {
                logger.Error(ex, ex.Message);
                return View("Error", new HandleErrorInfo(ex, "Publications", "Create"));
            }

        }

        // GET: Publications/Edit/5
        [HttpGet]
        [Authorize(Roles = "Admin")]
        public ActionResult Edit(int? id)
        {
            try
            {
                if (id == null)
                {
                    return new HttpStatusCodeResult(HttpStatusCode.BadRequest);
                }
                var publication = _factory.PublicationRepository.FindById(id);
                if (publication == null)
                {
                    //return HttpNotFound();
                    return View("ResourceNotFound");
                }

                var topics = _factory.TopicRepository.Get();
                List<string> ownTopics = new List<string>();
                foreach (var i in publication.Topics)
                {
                    string topicId = i.TopicId.ToString();

                    ownTopics.Add(topicId);
                }


                var publicationViewModel = new PublicationViewModel()
                {
                    PublicationId = publication.PublicationId,
                    NameOfPublication = publication.NameOfPublication,
                    Description = publication.Description,
                    Periodicity = publication.Periodicity,
                    Format = publication.Format,
                    Color = publication.Color,
                    Volume = publication.Volume,
                    PricePerMonth = publication.PricePerMonth,
                    AllTopics = topics,
                    OwnTopics = ownTopics.ToArray()
                };

                return View("Edit", publicationViewModel);
            }
            catch (Exception ex)
            {
                logger.Error(ex, ex.Message);
                return View("Error", new HandleErrorInfo(ex, "Publications", "Edit"));
            }
        }

        // POST: Publications/Edit/5
        [HttpPost]
        [Authorize(Roles = "Admin")]
        public ActionResult Edit(PublicationViewModel publicationViewModel, HttpPostedFileBase file)
        {
            try
            {
                if (ModelState.IsValid)
                {
                    publicationViewModel.AllTopics = _factory.TopicRepository.Get();
                   
                    Publication publication = _factory.PublicationRepository.FindById(publicationViewModel.PublicationId);
                    publication.Topics.Clear();
                    publication.PublicationId = publicationViewModel.PublicationId;
                    publication.NameOfPublication = publicationViewModel.NameOfPublication;
                    publication.Description = publicationViewModel.Description;
                    publication.Periodicity = publicationViewModel.Periodicity;
                    publication.Format = publicationViewModel.Format;
                    publication.Color = publicationViewModel.Color;
                    publication.Volume = publicationViewModel.Volume;
                    publication.PricePerMonth = publicationViewModel.PricePerMonth;
                    if (publicationViewModel.OwnTopics != null)
                    {
                        foreach (var c in TopicService.GetTopicsWhichContainSelectTopics(_factory, publicationViewModel.OwnTopics))
                        {
                            publication.Topics.Add(c);
                        }
                    }
                    if (file != null && file.ContentType.StartsWith("image"))
                    {
                        publication.ImgMimeType = file.ContentType;
                        publication.ImageBytes = new byte[file.ContentLength];
                        file.InputStream.Read(publication.ImageBytes, 0, file.ContentLength);
                    }
                    _factory.PublicationRepository.Edit(publication);
                    logger.Info("Издание {0} было изменено", publication.NameOfPublication);
                    TempData["SuccessMessage"] = "Издание было изменено.";
                    return RedirectToAction("Index");
                }

                return View(publicationViewModel);
            }
            catch (Exception ex)
            {
                logger.Error(ex, ex.Message);
                return View("Error", new HandleErrorInfo(ex, "Publications", "Edit"));
            }
        }

