        public ActionResult GetImagePublication(int id)
        {
            try
            {
                var publication = _factory.PublicationRepository.FindById(id);
                if (publication == null || publication.ImageBytes==null )
                {
                    byte[] imgArray1;
                    imgArray1 = Convert.FromBase64String("");
                    return File(imgArray1, "image/jpeg");
                }
                return File(publication.ImageBytes, publication.ImgMimeType);
            }
            catch (Exception ex)
            {
                logger.Error(ex, ex.Message);
                return View("Error", new HandleErrorInfo(ex, "Publications", "GetImagePublication"));
            }

        }

